import React from "react";
import './Dog.css'
const Dog = ({name, age, src,facts})=>{

    return(
        <div class="Dog">
            <img src={src} alt={name} />
            <div class="DogInfo">
                {name}<br></br>
                Age: {age} Years Old

            </div>
            <div class="facts">
                    <h4>Facts About {name}:</h4>
                    {facts.map(f=>(
                        <li>{f}</li>
                    ))}
                </div>


        </div>
    )

}

export default Dog;
